import { useEffect, useState } from "react";

function App() {
    const [tracks, setTracks] = useState([]);

    useEffect(() => {
        fetch("http://localhost:8080/api/tracks")
            .then(res => res.json())
            .then(data => setTracks(data))
            .catch(err => console.error(err));
    }, []);

    return (
        <div>
            {tracks.map(track => (
                <div key={track.id}>
                    <img src={track.cover} alt={track.title} width={100} />
                    <h3>{track.title}</h3>
                    <p>{track.artist}</p>
                    <span>{track.duration}</span>
                </div>
            ))}
        </div>
    );
}

export default App;
